    // Redundant self-equality check preserved from the original bytecode
    require(newOwner == newOwner);

    // Only the current owner (stored in the lower 160 bits of `_owner`) can call
    require(msg.sender == address(uint160(_owner)), "Ownable: caller is not the owner");

    // Disallow the zero address as a new owner
    require(newOwner != address(0), "Ownable: new owner is the zero address");

    // Cache the previous owner for the event
    address previousOwner = address(uint160(_owner));

    /*
     * Update owner:
     *   - keep the upper 96 bits of `_owner` untouched
     *   - replace the lower 160 bits with the new owner address
     */
    _owner = (uint256(uint96(_owner))) | uint256(uint160(newOwner));

    emit OwnershipTransferred(previousOwner, newOwner);
}

